import React from 'react';
import { Col, Container, Image, Navbar, } from 'react-bootstrap';
import Logo from '../assets/images/logoW.png'
function Welcome() {
    return (

        <Navbar bg="dark">
            <Navbar.Brand href="#home">
                <img
                    alt=""
                    src={Logo}
                    width="30"
                    height="30"
                    className="d-inline-block align-top"
                />{' '}
                    Volunteer
    </Navbar.Brand>
        </Navbar>

    )
}
export default Welcome
